import React from 'react';
import "./Card.css"
import Carddesign from './Carddesign';

const Card = () => {
  return (
    <div className='container'>
        <div className='row'>
            <div className='col-md-12 text-center'>
                <h1>OUR DOCTOR VISITS AT HOME</h1>
            </div>

            <Carddesign/>
        </div>
    </div>
  )
}

export default Card
